package com.wplab.fibonacci;

import java.math.BigInteger;

public class FibonacciInfo {
	int count;
	BigInteger[] fa;
	
	public FibonacciInfo() {
		// TODO Auto-generated constructor stub
	}

	public int getCount() {
		return count;
	}

	public void setCount(int count) {
		this.count = count;
	}

	public BigInteger[] getFa() {
		return fa;
	}

	public void setFa(BigInteger[] fa) {
		this.fa = fa;
	}
	
	
}
